import logo200Image from 'assets/img/logo/logo_200.png';
import PropTypes from 'prop-types';
import React from 'react';
import { withRouter } from "react-router-dom";
import {
  Button,
  Card,
  CardBody,
  CardHeader,
  Col,
  Form,
  FormFeedback,
  FormGroup,
  FormText,
  Input,
  Label,
  Row,
  CardText,
} from 'reactstrap';
import jwt_decode from 'jwt-decode';
import { register } from './UserFunctions';
import { login } from './UserFunctions';

class IotTest extends React.Component {
  constructor() {
    super()
    this.state = {
      first_name: '',
      last_name: '',
      email: '',
      password: '',
      errors: {}
    }

    this.onChange = this.onChange.bind(this)
    this.handleSubmit = this.handleSubmit.bind(this)
  }


  onChange(e) {
    this.setState({ [e.target.name]: e.target.value })
  }
 
  componentDidMount() {
  
  }

  handleSubmit = event => {
    event.preventDefault();
 

  };

 

  render() {
    

    return (
        
          <Row allowFullScreen>
             <Card>
                <CardHeader>Test Lab</CardHeader>
                <CardBody>
                  <Row>
            <Col md={6} sm={6} xs={12} className="mb-3">
              <Card>
                <CardHeader>Test Lab</CardHeader>
                <CardBody>
                <CardText>  Lorem ipsum dolor sit amet, consectetur adipisicing elit,
                      sed do eiusmod tempor incididunt ut labore et dolore magna
                      aliqua. Ut enim ad minim veniam, quis nostrud exercitation
                      ullamco laboris nisi ut aliquip ex ea commodo consequat.
                      Duis aute irure dolor in reprehenderit in voluptate velit
                      esse cillum dolore eu fugiat nulla pariatur. Excepteur sint
                      occaecat cupidatat non proident, sunt in culpa qui officia
                      deserunt mollit anim id est laborum.</CardText>
                </CardBody>
              </Card>
            </Col>
            <Col md={6} sm={6} xs={12} className="mb-3">
              <Card>
                <CardHeader>Test Lab</CardHeader>
                <CardBody>
                 <CardText>  Lorem ipsum dolor sit amet, consectetur adipisicing elit,
                      sed do eiusmod tempor incididunt ut labore et dolore magna
                      aliqua. Ut enim ad minim veniam, quis nostrud exercitation
                      ullamco laboris nisi ut aliquip ex ea commodo consequat.
                      Duis aute irure dolor in reprehenderit in voluptate velit
                      esse cillum dolore eu fugiat nulla pariatur. Excepteur sint
                      occaecat cupidatat non proident, sunt in culpa qui officia
                      deserunt mollit anim id est laborum.</CardText>
                </CardBody>
              </Card>
            </Col>
            </Row>
            </CardBody>
            </Card>
          </Row>
  
      );
  }
}



export default withRouter(IotTest);
